import fontawesome from '@fortawesome/fontawesome'
import { faPaperPlane } from '@fortawesome/fontawesome-free-solid'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './MessageForm.css';

fontawesome.library.add(faPaperPlane);

const MessageForm = () => {
  return (
    <form className="message-box">
      <input id="message" type="text" className="message-box__input"/>
      <button className="message-box__send" type="submit">
        <FontAwesomeIcon icon='paper-plane'></FontAwesomeIcon>
      </button>
    </form>);
};

export default MessageForm;
